export interface MatchModel {
  // Robot Information
  ScoutName: string;
  TeamNumber: number;
  MatchNumber: number;
  //Auto
  AutoGamePiece1: number; //amount of cubes
  AutoGamePiece2: number; // amount of cones
  AutoGamePiece3: number; // N/A
  AutoGamePiece4: number; // N/A
  AutoPosition: Position; //Left, Middle, Right
  AutoMobility: boolean; //Yes or No
  AutoObjective1: Objective; //Stage 1, 2, 3, 4
  AutoObjective2: Objective; //Stage 1, 2, 3, 4
  AutoRobotFalls: boolean; //Yes or No
  //Teleop + Endgame
  CycleTime: number[]; //array of cycle times
  EndGameObjective1: Objective; //Stage 1, 2, 3, 4
  EndGameObjective2: Objective; //Stage 1, 2, 3, 4
  DroppedGamePiece: number;
  // Robot Performance + match results
  Comment: string; //comment
  TotalPointsAlliance: number; //total points
  RankingPointsAlliance: number; //ranking points
  AllianceObjective1: number; //Links
  AllianceObjective2: boolean; //Coopertition
  WonMatch: boolean;
  TeleopStatus1: boolean; //Robot falls
  TeleopStatus2: boolean; //Incapacitated? --> if more than 8 seconds then considered YES
  TeleopStatus3: boolean; //plays defense
  TeleopStatus4: boolean; //Robot Tippy
  TeleopStatus5: Speed; //Robot Quickness
  TeleopStatus6: Aware; //Field Awareness
  TeleopGamePiece1: number; //Cubes
  TeleopGamePiece2: number; //Cones
  TeleopGamePiece3: number; //N/A
  TeleopGamePiece4: number; //n/A
  GamePiecesGrid: GamePieceCell[];
  gotScanned?: boolean;
}

export type GamePieceCell = {
  rowIndex: number;
  columnIndex: number;
  autoScored: number;
  GamePieceType: GamePieceType;
  count: number;
};

export enum GamePieceType {
  GamePiece1 = "Cone",
  GamePiece2 = "Cube",
  GamePiece3 = "3",
  GamePiece4 = "4",
}

export enum Objective {
  Stage1 = "Stage 1", // 2pts
  Stage2 = "Stage 2", // 4pts
  Stage3 = "Stage 3", // 6pts
  Stage4 = "Stage 4", // 8pts
}

export const AutoMobilityPoints = 6;

export enum Position {
  Left = "Left",
  Middle = "Middle",
  Right = "Right",
}

export enum Speed {
  Slow = "Slow",
  Average = "Average",
  Fast = "Fast",
}

export enum Aware {
  Minus = "Less aware",
  Normal = "Average",
  More = "Very aware",
}

export const initialMatchData: MatchModel = {
  ScoutName: "",
  TeamNumber: 0,
  MatchNumber: 0,
  AutoGamePiece1: 0,
  AutoGamePiece2: 0,
  AutoGamePiece3: 0,
  AutoGamePiece4: 0,
  AutoPosition: Position.Middle,
  AutoMobility: false,
  AutoObjective1: Objective.Stage1,
  AutoObjective2: Objective.Stage1,
  AutoRobotFalls: false,
  CycleTime: [],
  EndGameObjective1: Objective.Stage1,
  EndGameObjective2: Objective.Stage1,
  DroppedGamePiece: 0,
  Comment: "",
  TotalPointsAlliance: 0,
  RankingPointsAlliance: 0,
  AllianceObjective1: 0,
  AllianceObjective2: false,
  WonMatch: false,
  TeleopStatus1: false,
  TeleopStatus2: false,
  TeleopStatus3: false,
  TeleopStatus4: false,
  TeleopStatus5: Speed.Average,
  TeleopStatus6: Aware.Normal,
  TeleopGamePiece1: 0,
  TeleopGamePiece2: 0,
  TeleopGamePiece3: 0,
  TeleopGamePiece4: 0,
  GamePiecesGrid: Array.from({ length: 3 * 3 }, (_, index) => {
    const rowIndex = Math.floor(index / 3);
    const columnIndex = index % 3;

    return {
      rowIndex,
      columnIndex,
      autoScored: 0,
      GamePieceType: GamePieceType.GamePiece1,
      count: 0
    };
  }),


};


const InfoData = [
  {
    label: "Scout Name",
    key: "ScoutName",
    value: newMatchData.ScoutName,
    type: "text",
  },
  {
    label: "Match Number",
    key: "MatchNumber",
    value: newMatchData.MatchNumber.toString(),
    type: "number",
  },
];

const AutoData = [
  {
    label: "Auto Game Piece 1",
    key: "AutoGamePiece1",
    value: newMatchData.AutoGamePiece1,
    type: "number",
  },
  {
    label: "Auto Game Piece 2",
    key: "AutoGamePiece2",
    value: newMatchData.AutoGamePiece2,
    type: "number",
  },
  {
    label: "Auto Game Piece 3",
    key: "AutoGamePiece3",
    value: newMatchData.AutoGamePiece3,
    type: "number",
  },
  {
    label: "Auto Game Piece 4",
    key: "AutoGamePiece4",
    value: newMatchData.AutoGamePiece4,
    type: "number",
  },
  {
    label: "Auto Position",
    key: "AutoPosition",
    value: newMatchData.AutoPosition,
    type: "dropdown",
    droptype: PositionTypeItem,
  },
  {
    label: "Auto Mobility",
    key: "AutoMobility",
    value: newMatchData.AutoMobility,
    type: "boolean",
  },
  {
    label: "Auto Objective 1",
    key: "AutoObjective1",
    value: newMatchData.AutoObjective1,
    type: "dropdown",
    droptype: ObjectiveTypeItem,
  },
  {
    label: "Auto Objective 2",
    key: "AutoObjective2",
    value: newMatchData.AutoObjective2,
    type: "dropdown",
    droptype: ObjectiveTypeItem,
  },
  {
    label: "Auto Robot Falls",
    key: "AutoRobotFalls",
    value: newMatchData.AutoRobotFalls,
    type: "boolean",
  },
];

const TeleopData = [
  {
    label: "Average Cycle time",
    key: "CycleTime",
    value: newMatchData.CycleTime.toString(),
    type: "timer",
  },
  {
    label: "Grid",
    key: "GamePiecesGrid",
    value: newMatchData.GamePiecesGrid,
    type: "grid",
  },
  {
    label: "Number of dropped game pieces",
    key: "DroppedGamePiece",
    value: newMatchData.DroppedGamePiece,
    type: "number",
  },
];

const EndGameData = [
  {
    label: "Objective 1",
    key: "EndGameObjective1",
    value: newMatchData.EndGameObjective1,
    type: "dropdown",
    droptype: ObjectiveTypeItem,
  },
  {
    label: "Objective 2",
    key: "EndGameObjective2",
    value: newMatchData.EndGameObjective2,
    type: "dropdown",
    droptype: ObjectiveTypeItem,
  },
];

const PerformanceData = [
  {
    label: "Comment",
    key: "Comment",
    value: newMatchData.Comment,
    type: "text",
  },
  {
    label: "Total Points Alliance",
    key: "TotalPointsAlliance",
    value: newMatchData.TotalPointsAlliance,
    type: "number",
  },
  {
    label: "Ranking Points Alliance",
    key: "RankingPointsAlliance",
    value: newMatchData.RankingPointsAlliance,
    type: "number",
  },
  {
    label: "Links",
    key: "AllianceObjective1",
    value: newMatchData.AllianceObjective1,
    type: "number",
  },
  {
    label: "Coopertition",
    key: "AllianceObjective2",
    value: newMatchData.AllianceObjective2,
    type: "boolean",
  },
  {
    label: "Won Match",
    key: "WonMatch",
    value: newMatchData.WonMatch,
    type: "boolean",
  },
  {
    label: "Teleop Status 1",
    key: "TeleopStatus1",
    value: newMatchData.TeleopStatus1,
    type: "boolean",
  },
  {
    label: "Teleop Status 2",
    key: "TeleopStatus2",
    value: newMatchData.TeleopStatus2,
    type: "boolean",
  },
  {
    label: "Teleop Status 3",
    key: "TeleopStatus3",
    value: newMatchData.TeleopStatus3,
    type: "boolean",
  },
  {
    label: "Teleop Status 4",
    key: "TeleopStatus4",
    value: newMatchData.TeleopStatus4,
    type: "boolean",
  },
  {
    label: "Teleop Status 5",
    key: "TeleopStatus5",
    value: newMatchData.TeleopStatus5,
    type: "dropdown",
    droptype: SpeedTypeItem,
  },
  {
    label: "Teleop Status 6",
    key: "TeleopStatus6",
    value: newMatchData.TeleopStatus6,
    type: "dropdown",
    droptype: AwareTypeItem,
  },
  {
    label: "Cubes",
    key: "TeleopGamePiece1",
    value: newMatchData.TeleopGamePiece1,
    type: "number",
  },
  {
    label: "Cones",
    key: "TeleopGamePiece2",
    value: newMatchData.TeleopGamePiece2,
    type: "number",
  },
  {
    label: "N/A",
    key: "TeleopGamePiece3",
    value: newMatchData.TeleopGamePiece3,
    type: "number",
  },
  {
    label: "N/A",
    key: "TeleopGamePiece4",
    value: newMatchData.TeleopGamePiece4,
    type: "number",
  },
];
